add_css:
body {
  line-height: 1.6;
}

p {
  margin: 0 0 1.4em;
}

h1, h2, h3, h4, h5, h6,
.h1, .h2, .h3, .h4, .h5, .h6 {
  line-height: 1.3;
}

ol li, ul li {
  margin-bottom: 0.5em;
}

.list-unstyled li {
  margin-bottom: 0;
}

.page-header {
  background-color: #61A220;
  border-bottom: none;

  -moz-box-shadow: inset 0 0 15px -5px rgba(0, 0, 0, 0.7);
  -webkit-box-shadow: inset 0 0 15px -5px rgba(0, 0, 0, 0.7);
  box-shadow: inset 0 0 15px -5px rgba(0, 0, 0, 0.7);
}

.page-header * {
  color: #fff !important;
  text-shadow: 0 0 30px rgba(0, 0, 0, 0.3);
}

.navbar {
  padding: 10px 0px;
  border-bottom: none;
}

.web-footer {
  border-top: none;
}

.sidebar-item a:hover {
  color: #333;
  border-bottom: 2px solid #F28300;
}

.sidebar-item a.active {
  color: inherit;
  border-bottom: 2px solid #F28300;
}

.page-container a,
#wrap-footer a {
  text-decoration: none !important;
  border-bottom: 2px dotted #F28300;
}

.page-sidebar a,
.post-list a,
.parent-post a {
  text-decoration: none !important;
  border-bottom: none;
}


.page-container a:hover,
#wrap-footer a:hover {
  border-bottom: 2px solid #F28300;
}

.nav a:hover {
  border-bottom: none;
}

.leader-image {
  width: 150px;
  height: 150px;
  background-color: #eee;
  background-size: cover;
  background-position: center center;
  border-radius: 4px;
  float: left;
}

.leaders-social-icons {
  font-size: 150%;
  text-align: right;
}

.leaders-social-icons a {
  border-bottom: none;
  color: #777;
}

.leader-image-container {
  margin-right: 20px;
  margin-bottom: 15px;
}

.leader-image-container p {
  margin-top: 15px;
  margin-bottom: 0px
}

#nprogress .bar {
  background: #F28300;
}

#nprogress .peg {
  box-shadow: 0 0 10px #F28300, 0 0 5px #F28300;
}
